import img from "../images/dog5.png"

function Home(){
    return(
        <>
<section className="landing-page" style={{backgroundColor:'#fba633',height:'100vh'}}>
<div style={{ display: 'flex', alignItems: 'center', flexDirection: 'row' }}>
